import React, {useContext} from "react";
import { context } from "../context/CartContextProvider"

const Cart =()=>{

    const {productsCart} = useContext(context);
    return(


        <div>

            {productsCart.map((product, i)=>{
                return <h1>-{product.title}</h1>
        })}
        </div>
        
    )
}

export default Cart
